/* Login view from lazygram in react */

import { lg_api } from "../__modules__";
import { useState, useEffect } from "react";

export function Login() {
  // State
  const [notLog, setLog] = useState(null);

  console.log("Not log",notLog)
  useEffect(() => {
    async function FetchData() {
      const { data } = await lg_api("accounts/login/");
      console.log("Data fetched",data);
      setLog(data);
    }
    FetchData()
  }, []);

  return (

    <main>
      <section className="login">
        <div className="logo">
          <img src="" alt="copygram_logo"/>
          <h1>Lazygram</h1>
        </div>
        <div className="container-form">
          <form method="POST">

            <div className="container-form">
              <label for="id_username">Username</label>
              <label for="id_password">Password</label>
              <div className="d-grid gap-2 col-12 my-2">
                <button type="submit" className="btn btn-primary btn-lg">Login</button>
              </div>
              <div className="mx-auto">
                <span>Don't have an account? register now!</span>
              </div>
            </div>
          </form>
        </div>
      </section>
    </main>
  )
}
